import { Jumbotron, Row, Col } from "react-bootstrap";
import Button from "../../components/Button";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faEdit,
  faArrowDown,
  faArrowUp,
  faTruck
} from "@fortawesome/free-solid-svg-icons"; 

//scss
import "./index.scss";

export default function Dashboard() {
  return (
    <Jumbotron>
        <div className="dashboard d-flex flex-column justify-content-center">
      <h1 className="text-center">Welcome Hekeni!</h1>
      <br />
      <Row>
              <Col className="d-flex justify-content-start menu-button"><Button
              name="Sales Invoice"
              havingIcon={true}
              iconType={faEdit}
              buttonType="btn btn-primary btn-lg"
            /></Col>
              <Col><Button
              name="Sales Invoice"
              havingIcon={true}
              iconType={faEdit}
              buttonType="btn btn-primary btn-lg"
            /></Col>
          </Row>
      <div className="d-flex justify-content-center menu-button">

      <Button
              name="Sales Invoice"
              havingIcon={true}
              iconType={faEdit}
              buttonType="btn btn-primary btn-lg"
            />
            &nbsp;&nbsp;&nbsp;&nbsp;
            <Button
              name="Purcharse Invoice"
              havingIcon={true}
              iconType={faTruck}
              buttonType="btn btn-primary"
            />
      </div>
      <br />
      <div className="d-flex justify-content-center menu-button">
      <Button
              name="Inward Payment"
              havingIcon={true}
              iconType={faArrowDown}
              buttonType="btn btn-primary btn-lg"
            />
            &nbsp;&nbsp;&nbsp;&nbsp;
            <Button
              name="Outward Payment"
              havingIcon={true}
              iconType={faArrowUp}
              buttonType="btn btn-primary"
            />
      </div>
      <br />
      <br />
      <div className="d-flex justify-content-center account-button">
      <Button
              name="Inward Payment"
              havingIcon={true}
              iconType={faArrowDown}
              buttonType="btn btn-outline-info"
            />
            </div>
      </div>
    </Jumbotron>
  );
}
